@_3zrayil Kampaniya şərtləri ondan ibarətdir ki, siz kampaniya həftəsi çərçivəsində m10 keçərli olan satış nöqtələrində QR kod ilə minimum 5 azn olaraq 3-dən çox ödəniş etdiyiniz zaman sizə m10-dan unikal endirim kodu SMS olaraq daxil olacaqdır. Həmin kodu siz Wolt tətbiqində qeydiyyatdan keçdiyiniz zaman daxil edirsiniz və ilk 3 sifarişdə 3AZN endirim əldə edirsiniz.😍
