@huseynaliyev94 Artıq m10 hesabınıza daxil olan zaman, tətbiq sizdən üz tanıma keçməyinizi tələb edir. Bununla da, m10 hesabına yenidən giriş etmək yalnız hesab sahibi üçün mümkün olacaqdır. Müştəri OTP kodu paylaşsa belə, dələduzlar hesaba daxil ola bilməyəcəklər. Bunun nəticəsində, dələduzluq halları demək olar ki, 0-a endirilmişdir 💪

Bundan əlavə, daha öncə də müxtəlif kanallar ilə istifadəçilərimizi daima dələduzlar barədə məlumatlandırmışıq. Saxta hesablar yarandığı an, məsələ ilə bağlı müvafiq orqanlara məlumatlar ötürülürdü 🧐

Biz hər zaman sizin hesabınızın təhlükəsizliyini qoruyuruq və məsuliyyəti öz üzərimizə götürürük. Lakin, nömrənizi və OTP kodunuzu 3-cü şəxslər ilə bölüşdüyünüz halda, təəssüf ki, sizi qorumaq mümkün olmur 🙏

