@faridmm_0 Salam, Lotereyanın şərtlərini sizə təqdim edirik:
Minimal məbləğ 10 AZN və limitsiz sayda: 
- m10-la Bravo supermarketlər şəbəkəsində 10 AZN və üzəri üzəri alış-veriş etdikdə, həmçinin m10-da "Ödənişlər" bölümündəki olan xidmətlərə ödənişlər etdikdə (kredit ödənişləri xaric) lotereyada şans qazanırsınız 🙏💙

