Nağdlaşdırma qaydalarını sizə təqdim edirik : 
KapitalBank bankomatlarından komissiyasız, limitsiz nağdlaşdıra bilərsiniz. Bankomatda sağ tərəfdən 1-ci düyməyə toxunub-> "QR Kod" düyməsini seçib -> Məbləği qeyd edib daha sonra m10 tətbiqində ana səhifədə QR oxunmaya daxil olub, bankomatın ekranına gələn QR-ı scan edirsiniz. Tətbiqdə sizə verilən 6 rəqəmli təsdiq kodunu bankomatda qeyd edərək vəsaiti nağdlaşdıra bilərsiniz.💰

