@tt00000000002 Tərəfimizdən bütün mümkün olan tədbirlər görülür. Hazırda rəy yazdığınız paylaşım belə istifadəçilərimizi məlumatlandırmaq üçün yerləşdirilmişdir ✌

Siz öz şəxsi məlumatlarınızın təhlüləkəsizliyini qorumasanız, təəssüf ki, heç bir təhlükəsizlik sistemi sizin hesabınızı qoruya bilməz. OTP kod daxil olarkən, bunu heç kim ilə paylaşmamalı olduğunuz xüsusi olaraq qeyd olunur 🙏

Saxta hesablar yaradıldığı an, bununla bağlı məlumat müvafiq orqanlara ötürülür. Hesabların bloklanma müddəti ərzində isə məlumatlandırma aparılır davamlı olaraq 💙

@narmin74 Nərmin xanım, təəsssüf edirik ki, vəsait itkisi ilə üzləşmisiniz. Şəxsi məlumatlarınızın təhlükəsizliyini qoruduğunuz halda sizin hesabınızdan vəsait oğurlana bilməz, OTP kodu 3-cü şəxslərə təqdim etdiyiniz halda isə sizi qoruya bilmirik, təəssüf ki 🙏

Səhifəmizdə bir neçə dəfə bu dələduzluq halları ilə bağlı paylaşımlar edilmişdir və reklam çarxları da yerləşdirilmişdir. Dələduzluq ilə məşğul olan saxta hesablar haqqında isə müvafiq orqanlara mütəmadi olaraq məlumat təqdim olunur. 

